import React from "react";

export default function ToMars() {
    return (
        <div className="to-mars">
            <div className="to-mars-headline-container">
                <h1>TO <span>MARS</span> <br></br> AND BACK</h1>
                <div className="tag-charcoal">
                    <p>JOURNEY</p>
                </div>

            </div>
        </div>
    )
}
